export const Provinces = Object.keys(ADDRESS);
export const getCities = (province) => {
    try {
        return Object.keys(ADDRESS[province]['Municipality_list'])
    } catch {
        return []
    }
}
export const getBrgy = (province, city) => {
    return ADDRESS[province]['Municipality_list'][city]["Barangay_list"]
}
